function keyLog(key) {
  let tr = input[row];
  let box = tr.children[col];
  if (key.code.startsWith("Key") && col < 5) {
      box.innerHTML = key.key;
      box.className = "filled";
      col += 1;
  } else if (key.code === "Backspace" && col > 0) {
      col -= 1;
      box=tr.children[col];
      box.innerHTML = "";
      box.className = "";
  } else if (key.code === "Enter") {
      let word = "";
      for (j=0; j<5; j++) word += tr.children[j].innerHTML;
      if (col === 5 && row<5 && wordList.includes(word)) {
        document.body.removeEventListener("keydown", keyLog);
        clearInterval(timeInterval);
        const outcome = result(guessWord, word.split(""));
        const win = outcome.every(v => v === "green");
          mytimeOut = setTimeout(function() {
          document.body.addEventListener("keydown", keyLog);
          width = 100;
          timeInterval = setInterval(time, 50);
        }, 2500);
        for (i=0; i<5; i++) {
          tr.children[i].classList.add(outcome[i], 'solved');
          if (outcome[i] == "green" && row < 4 && !win){
            const place = input[row+1].children[i];
            place.classList.add("placeholder", "placeholder-delay");
            place.innerHTML = tr.children[i].innerHTML; 
          } 
        }
        if (win) gameEnd(true);
        else if (row == 4) gameEnd(false);
        else row+=1, col=0;
      } else {
        const error = document.getElementById("message");
        error.innerHTML = col == 5 ? "Word Not in Wordlist" : "Not enough letters";
        tr.classList.remove("row-error");
        error.classList.remove("error-message");
        tr.offsetWidth;
        error.classList.add("error-message");
        tr.classList.add("row-error");
      }
  }
}


function result(word, user) {
  const r = [];
  const c = {};
  for (i=0; i<5; i++){
      r.push("gray");
      if (word[i] === user[i]) {
          r[i] = "green";
          user[i] = 0;
      } else {
          if (word[i] in c) c[word[i]] += 1;
          else c[word[i]] = 1;
      }
  }
  for (j=0; j<5; j++) {
      if (user[j] in c && c[user[j]] > 0) {
          c[user[j]] -= 1;
          r[j] = "yellow";
      }
  }
  return r;
}


const bar = document.getElementById("progress");
let timeInterval;
let width  = 100;


function time() {
  if (width <= 0) {
    clearInterval(timeInterval);
    document.getElementById("new-game").classList.add("visible");
    gameEnd(false);
  }
  else width -= 0.25;
  bar.style.width = `${width}%`;
}


function newGame() {
  document.getElementById("new-game").setAttribute("disabled", "");
  for (i=0; i<input.length; i++) {
    for (j=0; j<input[i].children.length; j++) {
      input[i].children[j].innerHTML = "";
      input[i].children[j].classList = "";
    }
  }
  let number = Math.floor(Math.random() * wordList.length);
  guessWord = wordList[number];
  row = 0;
  col = 0;
  input[0].children[0].innerHTML = guessWord[0];
  input[0].children[0].classList.add("placeholder");
  document.getElementById("new-game").classList = "";
  document.getElementById("message").classList.remove("info-message");
  document.getElementById("message").innerHTML = "";
  document.body.addEventListener("keydown", keyLog);
  width = 100;
  setTimeout(  function() {timeInterval = setInterval(time, 50)}, 500);
}


function gameEnd(win) {
  clearTimeout(mytimeOut);
  document.body.removeEventListener("keydown", keyLog);
  if (!win){
    document.getElementById("message").innerHTML = guessWord;
    document.getElementById("message").classList = "info-message";
  }
  document.getElementById("new-game").classList.add("visible-delay");
    document.getElementById("new-game").removeAttribute("disabled");
}

document.getElementById("new-game").classList.add("visible");
setTimeout( function() {
    document.querySelector("a").setAttribute("tabindex", "-1");
    }, 50);
